Here's an example of the EventHandler trait in action. #[derive(Debug)]
struct Handler {} #[derive(Debug)]
enum Message { Stuff(&'static str),
} #[async_trait]
impl EventHandler for Handler { type Message = Message; type GitHubClient = Client<Self>; fn listener_port(&self) -> u16 { 2022 } async fn message(&self, message: Self::Message) { match message { Message::Stuff(s) => { println!("==> Message received: {s}"); } } } async fn commit_event( &self, github_client: Arc<Self::GitHubClient>, commit: PushEvent, ) -> Command<Self::Message> { println!("Commit pushed!"); Command::perform(async { "Computation finished" }, Message::Stuff) }
} #[tokio::main]
async fn main() -> Result<()> { ClientBuilder::new().event_handler(Handler {}).build()?.start().await; Ok(())
}

