Message The enum which you recieve when a future from a Command is completed. trait EventHandler { type Message: std::fmt::Debug + Send, ... async fn message(&self, message: Self::Message) { {} } ...
} GitHubClient In 99% of cases, this type should be set equal to Client<Self>. Client<Self> is the default value. You shouldn't have to override this unless you're writing your own custom GitHubClient implementation (not recommended) This is used to represent the type of the github_client parameter present in each event. #[async_trait]
trait EventHandler { type GitHubClient: GitHubClient + Send + Sync; ... async fn example_event( &self, github_client: Arc<Self::GitHubClient>, example_event: ExampleEventType, ) -> Command<Self::Message> { Command::none() } ...
}

